import React from 'react'
import blogposts from '../../Components/blogposts';
import sidebar from '../../Components/sidebar';

import './style.css';

const Post=(props)=>{
    return(
        <section className="container">
                   <blogposts/>
                   <sidebar/>
                   
        </section>
    )
}

export default Post;
